css:
.github-StagingView {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-group {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-header {
  display: flex;
  align-items: center;
  padding: 0 0 0 10px;
  font-weight: 600;
  border-top: 1px solid transparent;
  border-bottom: 1px solid transparent;
}
.github-StagingView-group:first-child .github-StagingView-header {
  border-top: none;
}
.github-StagingView-header .icon {
  text-align: center;
}
.github-StagingView-header .icon:before {
  color: #999;
  margin-right: 8.33333333px;
  vertical-align: middle;
}
.github-StagingView-headerButton {
  height: 2.5em;
  border: none;
  padding: 0 10px;
  font-weight: normal;
  border-left: 1px solid transparent;
  white-space: nowrap;
  background: none;
  cursor: default;
}
.github-StagingView-headerButton:disabled {
  color: #999;
}
.github-StagingView-headerButton:active {
  background-color: #ffffff;
}
.github-StagingView-headerButton.icon:before {
  margin-right: 0;
  font-size: 1em;
  text-align: left;
}
.github-StagingView-headerButton--fullWidth {
  border-left: none;
  border-bottom: 1px solid transparent;
}
.github-StagingView-title {
  flex: 1;
  margin-right: 10px;
  line-height: 2.5em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.github-StagingView-list {
  flex: 1 1 0;
  overflow-x: auto;
}
.github-StagingView-group-truncatedMsg {
  padding: 5px 10px;
}
.github-StagingView-group.is-focused .is-selected {
  color: #fff;
  background: #6aa5e9;
}
.github-StagingView:focus .github-StagingView-group.is-focused .is-selected {
  color: #ffffff;
  background: #888;
}
